ScriptManager.clearTimer();
function lyric(txt,Vlifetime)
{ 
  len = txt.length;
  for (var i = 0; i<(len+2); i++)
    {
         sub=txt.substring(i-1,i);
     var w = Player.width; 
     var h = Player.height; 
     var life = Vlifetime;
     var fz = w/32;    
     var a = 0.4; 
     var b = life-2*a; 
     var cv=$.createCanvas({
                            y:h*0.3,
                            lifeTime:life
});
     var d = $.createComment(txt,{lifeTime:a,alpha:0,fontsize:fz});
     var c = $.createComment(sub,{ 
             y:0,
             lifeTime:life,
             fontsize:fz, 
             x:100,
             parent:cv            
    });
c.color="0xffffff";
c.filters=[$.createGlowFilter(0x336666,1,4,4,2,1,false,false),$.createBlurFilter(10,10)];
c.font="微软雅黑";
cv.x=150;
var a1 = Tween.tween(c,{alpha:1},{alpha:0},a);
var a2p = Tween.tween(c,{alpha:0},{alpha:1},a);
var a2 = Tween.delay(a2p,b-a);
var m1 = Tween.tween(c,{x:-d.textWidth/2+i*fz+(i-len/2)*9},{x:-d.textWidth/2+i*fz+(i-len/2)*3},b);
var blr1 = Tween.tween(c,{_blurFilter:{blurX:0, blurY:0}},{_blurFilter:{blurX:10, blurY:10}},1);
(Tween.parallel(a1,a2,m1,blr1)).play();
   };}
