ScriptManager.clearTimer();
function lyric(txt,Vlifetime)
{
  var i=0;  
       interval(
       function()
                 {   i++;   
                     len=txt.length;
                     sub=txt.substring(i-1,i);
     var w = Player.width; 
     var h = Player.height; 
     var life = Vlifetime;
     var a = 0.2; 
     var b = life-2*a; 
var cv=$.createCanvas({
                        y:20,
                        lifeTime:life
});
     var d = $.createComment(txt,{lifeTime:a,alpha:0,fontsize:w/32});
     var c = $.createComment(sub,{ 
             lifeTime:life, 
             fontsize:w/32, 
motionGroup:[{alpha: {fromValue:0,toValue:1,lifeTime:a},x:{fromValue:-10,toValue:0,lifeTime:a}}, 
              {alpha: {fromValue:1,toValue:1,lifeTime:b-0.11*i}}, 
             {alpha: {fromValue:1,toValue:0,lifeTime:a}}],
              parent:cv            
    });
c.color="0xffffff";
c.filters=[$.createGlowFilter(0x336666,1,w/100,w/100,2,1,false,false)];
c.font="微软雅黑";
c.x=-120; 
cv.x=$.width/2-d.textWidth/2+w/32*(i-1);
   },100,len); }
lyric("「夢（ゆめ）の消（き）えた毎日（まいにち）を",2);

ScriptManager.clearTimer();
function lyric(txt,Vlifetime)
{
     var w = Player.width; 
     var h = Player.height; 
     var life = Vlifetime;
     var a = 0.3; 
     var b = life-2*a; 
var cv=$.createCanvas({y:h*0.85,x:250,
                        lifeTime:life,
                        motionGroup:[
{rotationX:{fromValue:-180,toValue:0,lifeTime:a},
y:{fromValue:h*0.87+20,toValue:h*0.87,lifeTime:a}
} ]
});
     var c = $.createComment(txt,{ 
             lifeTime:life,
             fontsize:w/32, 
motionGroup:[{alpha: {fromValue:0,toValue:1,lifeTime:a}}, 
             {alpha: {fromValue:1,toValue:1,lifeTime:b}}, 
             {alpha: {fromValue:1,toValue:0,lifeTime:a}}],
 parent:cv             
    });
c.color="0xffffff";
c.filters=[$.createGlowFilter(0x336666,1,w/100,w/100,2,1,false,false)];
c.font="微软雅黑";
c.y=-c.textHeight/2;
cv.x=$.width/2-c.textWidth/2;
};
